request.description:
üì¢ Company (dossier) Exercices. If an exercise is not closed **closed_at** and **closed_by** are set to `null`.

Exercices labels are `N+1`, `N`, `N-1`, `N-2` etc.

``` ts
interface Exercice {
  exercice_id: number;
  start_date: string;
  end_date: string;
  /**Label de l'exercice ( N-1, N, N+1 etc..). */
  label: string;
  result: number;
  /* Chiffre d'affaire sur l'exercice. */
  ca: number;
  closed: boolean;
  duration: number;
  closed_at: null | string;
  /** ID de l'utilisateur qui a clot√ªr√© l'exercice. */
  closed_by: null | number;
  review_model: {
    label: string;
    id_review_model: number;
  };
  lettering_method_id: number;
}

```

La propri√©t√© lettering_method_id permet de savoir si l'exercice est **MONO** ou **MULTI**. Par d√©faut un exercice est **MONO**.

- 1\. MONO
- 2\. MULTI


‚ö†Ô∏è A `society-id` is required with a cabinet/firm access

